pragma solidity ^0.4.17;

import "./ITimelineDocumentLib.sol";
import "../Timeline.sol";
import "./TimelineDocument.sol";

/**
 * ITimelineDocumentLib implementation v1.0
 *
 * Copyright (c) 2017 Cognate, Inc.
 */
library TimelineDocumentLib {

    /**
     * Restriction modifier, restricts access of methods to the latest top level timeline in
     * the upgrade schema of the owning timeline
     */
    modifier onlyControllingTimeline() {
        require(msg.sender == owned(this).owner() || (Timeline(owned(this).owner()).upgraded() && msg.sender == Timeline(owned(this).owner()).owner()));
        _;
    }

    function setNext(ITimelineDocumentLib.TimelineDocumentStorage storage self, TimelineDocument next) public onlyControllingTimeline {
        self._next = next;
    }

    function setPrev(ITimelineDocumentLib.TimelineDocumentStorage storage self, TimelineDocument prev) public onlyControllingTimeline {
        self._prev = prev;
    }

    function addProof(ITimelineDocumentLib.ClaimStorage storage self, address proof) public onlyControllingTimeline {
        self._proofs.push(proof);
    }

    function setLocation(ITimelineDocumentLib.ProofDocumentStorage storage self, string location) public onlyControllingTimeline {
        self._location = location;
    }
}
